    return(
        <PortfolioCardContainer>
            <img src={"/portfoliocardDP.png"}  alt="temporary dp photo" style={{ borderRadius:'10px',width: '250px',marginTop:'2rem', marginBottom:'1rem'}} />
            <PortfolioCardLayout></PortfolioCardLayout>
        </PortfolioCardContainer>
    )
}
